import "./Service.css";
import Services from "../Services/Services";
const students = [
    {name:'John', age: 10},
    {name:'Victor', age: 40}
]

// const newSts = students.map(function(st){
//     return st
// })
function Service(props) {
    return (
        <div>
            <div className="boxes">
                {students.map(function(item){
                    return <p>{item.name}</p>
                })}
                <div className="box_1" style={{ backgroundColor: props.bgcolor }}></div>
                <div className="box_2" >
                    <span>{props.title}</span>
                    <p className="mt-0">{props.content}</p>
                </div>
            </div>
        </div>


    )
}
export default Service;
